from sortedcontainers import SortedList
class Solution:
    def countSmaller(self, nums: list[int]) -> list[int]:
        

        # Intution: 
        # Intution 1. We can sort the array and the index will tell us the number of elements smaller than the current element
        # Concern: This will fail becoz we need to return the original order of the elements

        # Intution 2. We can iterate from right to left and keep track of the elements in a sorted array
        # Using binary serach we can find the index of the current element in the sorted array
        # The index will tell us the number of elements smaller than the current element
        # Concern: Need to handle for duplicates. In this case you have to insert in left most index, becoz previous occurence of this number should not be accounted for 
        # the current number

        # def get_position(slist, num):
        #     n = len(slist)
        #     left = 0
        #     right = n-1

        #     while left <= right:
        #         mid = left + (right-left)//2
        #         if slist[mid] >= num:
        #             right = mid - 1
        #         else:
        #             left = mid + 1
            
        #     return left

        # n = len(nums)
        # res = []
        # sorted_list = [float('inf')]*n
        
        # for i in range(n-1, -1, -1):    
        #     idx = get_position(sorted_list, nums[i]) 
        #     res.append(idx)
        #     sorted_list.insert(idx,nums[i])

        # res.reverse()

        # return res

        n = len(nums)
        res = []
        sorted_list = SortedList([])

        for i in range(n-1, -1, -1):    
            idx = sorted_list.bisect_left(nums[i]) 
            res.append(idx)
            sorted_list.add(nums[i])
        
        res.reverse()

        return res
    
